if isShinobi then
	--Variables
	local plr = game:service'Players'.LocalPlayer;
	local hrp = plr.Character:FindFirstChild'HumanoidRootPart';

	--Get position
	getPos = function(position, divison)
		local a = Instance.new("Part", workspace);
		a.CFrame = CFrame.new(hrp.Position, position);
		a.Anchored = true;
		amnt = -(position - a.Position).magnitude/division;
		a.CFrame = a.CFrame * CFrame.new(0, 0, amnt);
		position = a.CFrame;
		a:Destroy();
		return position;
	end;

	--Teleport player
	getgenv().safeTeleport = function(position)
		repeat game:service'RunService'.RenderStepped:Wait()
			distance = (hrp.Position - position).magnitude;
			if (distance > 1000) then
				division = 125;
			else
				division = 15;
			end;
			for i, v in next, plr.Character:GetChildren() do
				if v:IsA'BasePart' then
					v.CanCollide = false;
				end;
			end;
			hrp.CFrame = getPos(position, division);
			hrp.Velocity = Vector3.new();
		until distance < 5;
	end;
	--safeTeleport(Vector3.new(22225, 676, -15815));	
end;

