			for i,vehicle in next, workspace.Vehicles:GetChildren() do
				if vehicle:FindFirstChild'Seat'
					and vehicle.Seat:FindFirstChild'PlayerName'
					and vehicle.Seat.PlayerName.Value == LocalPlayer.Name then
					vehicle.PrimaryPart = vehicle.Seat;
					vehicle:SetPrimaryPartCFrame(CFrame.new(v3value));
					delay(.2, function() 
						ExitVehicle();
						getgenv().teleportcomplete = true;
					end);
				end;
			end;
			]]
			desiredPos = CFrame.new(v3value.X, v3value.Y, v3value.Z);
			local LocalPlayer = game:service'Players'.LocalPlayer;
			LocalPlayer.PlayerGui.MainGui.Enabled = false;
			origcameraloc = workspace.CurrentCamera.CFrame;
			origcamerafov = workspace.CurrentCamera.FieldOfView;
			velConn = game:service'RunService'.RenderStepped:Connect(function()
				LocalPlayer.Character.HumanoidRootPart.Velocity = Vector3.new();
				--workspace.CurrentCamera.CFrame = origcameraloc;
				workspace.CurrentCamera.FieldOfView = origcamerafov;
			end);
			local terrainRegion = workspace.Terrain:CopyRegion(workspace.Terrain.MaxExtents)
			workspace.Terrain:Clear()
			function Restore()
				for i, v in next, workspace:GetDescendants() do
					if v:IsA'BasePart' and v:FindFirstChild'Affected' then
						v.Affected:Destroy();
						v.CanCollide = true;
					end;
				end;
				workspace.Terrain:PasteRegion(terrainRegion, workspace.Terrain.MaxExtents.Min, true);
			end;
			Alive = function()
				if not LocalPlayer.Character or LocalPlayer.Character:FindFirstChildOfClass'Humanoid'.Health <= 0 or not LocalPlayer.Character:FindFirstChild'HumanoidRootPart' then
					Restore();
					velConn:Disconnect();
					LocalPlayer.PlayerGui.MainGui.Enabled = true;
					return true;
				end;
				return false;
			end;
			if Alive() then return; end;
			LocalPlayer.Character:FindFirstChildOfClass'Humanoid'.Name = 'a';
			for i, v in next, workspace:GetDescendants() do
				if v:IsA'BasePart' and v.CanCollide == true and not v:IsDescendantOf(workspace.Vehicles) then
					a = Instance.new("Model");
					a.Parent = v;
					a.Name = "Affected";
					v.CanCollide = false;
				end;
			end;
			function Stuff()
				print'c'
				stop = false;
				if not getgenv().blackListedVehicles then
					getgenv().blackListedVehicles = {};
				end;
				
				for i, vehicle in next, workspace.Vehicles:GetChildren() do
					if vehicle.Name == 'Camaro'
						and vehicle:FindFirstChild'Seat'
						and vehicle.Seat:FindFirstChild'PlayerName'
						and vehicle.Seat.PlayerName.Value == '' then
						no = false;
						for k, d in next, blackListedVehicles do
							if d == vehicle then
								no = true;
							end;
						end;
						if not no then
							getgenv().car = vehicle;
							break;
						end;
					end;
				end;
				
				if not car then
					blur:Destroy();
					velConn:Disconnect();
					return;
				end;
				
				hrp = LocalPlayer.Character.HumanoidRootPart;
				--hrp.CFrame = hrp.CFrame * CFrame.new(0, 100, 0);
				v3value = Instance.new("Vector3Value");
				v3value.Value = car.Seat.Position;
				carPos = v3value.Value;
				spawn(function()
					while 1 and not hrp.Parent:FindFirstChildOfClass'Humanoid'.Sit and LocalPlayer.Character do
						car:SetPrimaryPartCFrame(hrp.CFrame * CFrame.new(0, -5, 0));
						hrp.CFrame = CFrame.new(hrp.CFrame.X, carPos.Y, hrp.CFrame.Z);
						hrp.Parent:FindFirstChildOfClass'Humanoid':MoveTo(hrp.Position + Vector3.new(0, 0, math.random(-5, 5)));
						hrp.Velocity = Vector3.new();
						wait(.4);
						if stop or Alive() then
							break;
						end;
					end;
				end);
				for i = 1,5 do
					wait(.5);
					if Alive() then break; end;
					if (hrp.Position - carPos).magnitude < 50 or i == 5 or Alive() then
						stop = true;
						break;
					end;
				end;
				if not Alive() then LocalPlayer.Character:FindFirstChildOfClass'Humanoid'.Name = 'Humanoid'; end
				VehicleEnter(car.Seat);
				wait(.5);
				if not Alive() and not LocalPlayer.Character:FindFirstChildOfClass'Humanoid'.Sit then
					table.insert(blackListedVehicles, car);
					stop = true;
					Stuff();
				else
					car:SetPrimaryPartCFrame(desiredPos * CFrame.new(0, -100, 0));
					wait(.5);
					ExitVehicle();
					wait(.5);
					if hrp then hrp.CFrame = desiredPos; end;
					stop = true;
					LocalPlayer.PlayerGui.MainGui.Enabled = true;
					velConn:Disconnect();
					Restore();
					getgenv().car = nil;
				end;
			end;
			Stuff();
		end);
		--[[
